script: |
  super -f text -I q12768.spq | sort > q12768.out

inputs:
  - name: q12768.spq
    data: |
      SELECT - + col1 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + col0 BETWEEN + + col0 AND col0 * - + CAST ( NULL AS INTEGER ) * - - CAST ( + col0 AS INTEGER ) + 6;
  - name: tab2

outputs:
  - name: q12768.out
    data: |
